The International Encyclopedia of Human Geography provides an authoritative and comprehensive source of information on the discipline of human geography and its constituent, and related, subject areas.
The encyclopedia includes over 1,000 detailed entries on philosophy and theory, key concepts, methods and practices, biographies of notable geographers, and geographical thought and praxis in different parts of the world.

